import React, { useState } from 'react'
import Todo from './Todo'

function TodoList({ todos, todoDelete, todoToogleCompleted }) { //  recibimos la funcion todoDelete que viene desde App de aqui se la enviamos a cada todo y se la pasamos al componente Todo ver mas abajo

    return (
        <div>
            <h1>TodoList</h1>
            {
                todos.map(todo => (
                    <Todo
                        todo={todo}
                        key={todo.id}
                        todoDelete={todoDelete} //ahora ya la funcion la podemos usar en componente Todo
                        todoToogleCompleted={todoToogleCompleted} //la enviamos al Todo
                    />
                ))
            }
        </div>
    )
}

export default TodoList
